(161, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:69:\"How to Create a Link in Bio Landing Page For Instagram With Elementor\";s:7:\"excerpt\";s:269:\"If you\'re using Instagram to connect with your audience, Instagram only gives you one option to send visitors to your website - the link in your Instagram bio. In this post, you\'ll learn how to use Elementor to create a dedicated link in bio landing page for Instagram.\";s:7:\"created\";s:10:\"1593689841\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:160:\"https://elementor.com/blog/create-link-in-bio-landing-page-for-instagram-with-elementor/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:47:\"21 Best WooCommerce Plugins You Should be Using\";s:7:\"excerpt\";s:234:\"With thousands of options out there, how do you sift through them all and find the best WooCommerce plugins for your store? Worry not — We\'ve gone through and curated 20+ plugins that can help your online store in different ways.​\";s:7:\"created\";s:10:\"1593608994\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/woocommerce-plugins/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:41:\"How to Create and Customize a Child Theme\";s:7:\"excerpt\";s:207:\"What is a child theme and why is it so important? In this post, we\'ll give you the answers to those questions and show you step-by-step how to create and customize your own child theme using plugins or code.\";s:7:\"created\";s:10:\"1593430412\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/wordpress-child-theme/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:73:\"Build Yourself as a Creative — Takeaways From Our Webinar With Chris Do\";s:7:\"excerpt\";s:191:\"On our recent webinar with Chris Do, founder of The Futur, we discussed how to recreate yourself as a design professional. Here are the main takeaways from this enlightening discussion.​​\";s:7:\"created\";s:10:\"1593092641\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/webinar-chris-do/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:45:\"How to Create a Lottie Widget Download Button\";s:7:\"excerpt\";s:173:\"This guide to Lottie Animations will show you a creative way to use the Lottie widget as a button and set it to play an animation and download a free eBook upon clicking it.\";s:7:\"created\";s:10:\"1592983739\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/lottie-animations/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
