(80, 1, '2017-06-20 11:59:47', '2017-06-20 11:59:47', 'There are various ways for creating online CV and Resume. We recommend to create an online CV using one of our WordPress themes. We will show some basic tips of creating online CV in example of Certy. What you need to remnember is that you need to show yourself in professional and eye catching way despite all weakneces. So the purpose of the online CV is to underline your strongest skills and points, show achievements and provide positive and professional impression on your future Employer.\n<ul>\n 	<li>Make an accurate and attractive couple photos of you and use in certy as first image and hover image. For example: 1st photo can be image of you with professional look and second image can be image with smile which may have positive effect on employer</li>\n 	<li>Welcome to visitors of your online CV and tell briefly about online CV and what they will find here or why you have created it</li>\n 	<li>Create a structure of your site in mind, write down on paper or somwhere else, you need to have structurized and logical data</li>\n 	<li>Need to understand you need to create resume with all sections on one page or you will have different section in different pages</li>\n 	<li>In case of one page resume structure may be following =&gt; About me =&gt; Personal Information =&gt; Professional Skills =&gt; Work Experience =&gt; Education =&gt; Achievements =&gt; Portfolio =&gt; Contact me or call to action button</li>\n 	<li>It is important to add some call to action button or contact section to the end of your page</li>\n</ul>', 'How to Create Online CV and Resume', '', 'publish', 'open', 'open', '', 'how-to-create-online-cv-and-resume', '', '', '2017-06-20 11:59:47', '2017-06-20 11:59:47', '', 0, 'http://certy.px-lab.com/designer/?p=80', 0, 'post', '', 0),
